<!DOCTYPE html>

<html lang="en" xmlns="http://www.w3.org/1999/xhtml">
<head>
    <meta charset="utf-8" />
    <title>Marc Fortier</title>
    <link rel="stylesheet" href="https://www.w3schools.com/w3css/4/w3.css">
    <style type="text/css">
        html, body {
            height: 100%;
            overflow: hidden;
            padding: 0px;
            line-height: 5px;
        }

        body {
            padding: 0;
            margin: 0;
        }

        table {
            border: none;
            border-collapse: collapse;
            border-spacing: 0px;
            height: 100%;
            width: 100%;
            padding: 0;
            margin: 0;
        }
        tr {
            border: none;
            padding: 0;
            margin: 0;
        }

        td {
            border: none;
            padding: 0;
            margin: 0;
        }

        img {
            vertical-align: top;
        }

    </style>
    <script>
        window.onload = function () {
            ResponsiveAreaLinks();
            //ArrangeSizes(); // Add this function for PowerPoint WebBrowser. To use remove comment bar //
        }

        window.onresize = ResponsiveAreaLinks;

        function ResponsiveAreaLinks() {
            var img = document.getElementById("img-content");
            var links = img.parentElement.getElementsByTagName("a");
            var ratioW = img.width / parseFloat(img.getAttribute("orig-calc-width"));
            var ratioH = img.height / parseFloat(img.getAttribute("orig-calc-height"));

            for (var i = 0; i < links.length; i++) {
                var a = links[i];
                a.style.width = (parseFloat(a.getAttribute("orig-calc-width")) * ratioW) + "px";
                a.style.height = (parseFloat(a.getAttribute("orig-calc-height")) * ratioH) + "px";

                a.style.top = (parseFloat(a.getAttribute("orig-calc-top")) * ratioH) + "px";
                a.style.left = (parseFloat(a.getAttribute("orig-calc-left")) * ratioW) + "px";
            }
        }

        function OpenContent(title, type, url) {
            if (type == "Image") {
                document.getElementById('img-modal').title = title;
                document.getElementById('img-modal').src = url;
                document.getElementById('modal').style.display = 'block'
            }
            else {
                window.open(url);
            }
        }

        function CloseModal() {
            document.getElementById('modal').style.display = 'none'
        }
            // Note: use href instead of click and touchstart for windows/android/iphone compatibility

        // Add this function for PowerPoint WebBrowser.
        function ArrangeSizes() {
            var screenWidth = document.documentElement.clientWidth;
            var screenHeight = document.documentElement.clientHeight;
            var images = document.images;
            var bannersHeight = 0;

            for (var i = 0; i < images.length; i++) {

                if (images[i].id == "img-content") {
                    images[i].parentElement.style.width = (screenWidth - 4) + "px";
                    images[i].style.width = (screenWidth - 21) + "px";

                }
                else {
                    images[i].style.width = screenWidth + "px";
                    bannersHeight += images[i].clientHeight;
                }
            }

            document.getElementById("img-content").parentElement.style.height = (screenHeight - bannersHeight) + "px";
        }
    </script>
</head>

        <div id="modal" class="w3-modal">
            <div class="w3-modal-content" style="background-color: transparent;">
                <a class="w3-container" style="padding:0;" href="javascript:CloseModal()">
                    <img id="img-modal" title="" src="" width="100%" />
                </a>
            </div>
        </div>
    </div>
